import React, { Component } from 'react';
import axios from "axios";

class Login extends Component {
state = {
			email : '',
			password : '',
			result : '',
		}

	constructor(props){
		super(props);
		this.emailRef = React.createRef();
		this.passwordRef = React.createRef();


	}



	login(){

		console.log(this.emailRef.current);
	}
	render(){
		return (
			<div className="container">
				<form method="POST" action="/connection" onSubmit={this.login}  >
					<div className="form-group">
						<label>Email</label>
					    <input type="email" className="form-control" name="email" placeholder="email" ref={this.emailRef} required />
					</div>
					<div className="form-group">
						<label>Password</label>
					    <input type="password" className="form-control" name="password" ref={this.passwordRef} required />
					</div>
					<button type="submit" className="btn btn-primary">Submit</button>
				</form>
			</div>
			)
	}
}
export default Login;
